const INITIAL_STATE = {};

export default function auth(state = INITIAL_STATE, action) {
    switch (action.type) {
        case '@auth/SIGN_IN_SUCESS':
            return state;

        case '@auth/SIGN_FAILURED':
            return;
        default:
            return state;
    }
}
